  ngOnInit(): void {
    this.data = data;
    this.viewVisitorStructure = viewVisitorFields
    this.checkinInfoStructure = checkinInfo
    //this.getLocation();
    this.ActivatedRoute.queryParams.subscribe(params => {
      if (params['id'] === "NewVisitor") {
        this.name = 'NewVisitor';
        this.isnew = false;
      } else {
        if (params['src'] && params['src'] == 'ent') {
          this.is_from_dashboard = true;
          this.checkin_service = false;
        }
        this.isnew = true;
        //this.name = params['id'].split("_")[0] + " " + params['id'].split("_")[1];
        this.name = params['id'];
      }
      this.viewVisitor(this.name);
      this.checkinInfo(this.name);
    })
  }
  viewVisitor(name) {
    // for (var i = 0; i < this.data.length; i++) {
    //   if (name == this.data[i]['FullName']) {
    //     var obj = this.data[i];
    //   }
    // }
    if (name === "NewVisitor") {
      (<HTMLInputElement>document.getElementById("visitorImage")).src = "assets/images/blankImg.png";
      for (var i = 0; i < this.viewVisitorStructure.length; i++) {
        if (this.viewVisitorStructure[i]['FieldType'] == 'text field') {
          $('#div1').append("<label class='fontColor' style='color:rgb(141 141 141);'>" + this.viewVisitorStructure[i]['Field'] + "</label><br> <input type='text' id='" + this.viewVisitorStructure[i]['id'] + "' placeholder='" + this.viewVisitorStructure[i]['Placeholder'] + "'  style='padding-left: 15px;border: none;border-bottom: 1px solid #bfbfbf;width: 100%;height: 28px;'><br><span class='" + this.viewVisitorStructure[i]['id'] + "' style='color:red;'></span><br>")
        }
      }
      // $('#div1').append("<div style='display:grid;grid-template-columns: auto auto;width: 6cm;'><img style='height: 20px;width: 20px;' src='assets/images/messageIcon.png'><div style='    font-size: 14px;color: #7d6dd3;'>This Visitor was Invited</div></div>");
      $('#Name').val('');
      $('#Email').val('');
      $('#Contact').val('');
      $('#Purpose').val('');
      $('#Host').val('');
    } else {
      for (var i = 0; i < this.viewVisitorStructure.length; i++) {
        if (this.viewVisitorStructure[i]['FieldType'] == 'text field') {
          $('#div1').append("<label class='fontColor' style='color:rgb(141 141 141);'>" + this.viewVisitorStructure[i]['Field'] + "</label><br> <input type='text' id='" + this.viewVisitorStructure[i]['id'] + "' placeholder='" + this.viewVisitorStructure[i]['Placeholder'] + "'  style='padding-left: 15px;border: none;border-bottom: 1px solid #bfbfbf;width: 100%;height: 28px;' ><br><span class='" + this.viewVisitorStructure[i]['id'] + "' style='color:red;'></span><br><br>")
        }
      }
      $('#div1').append("<div style='display:grid;grid-template-columns: auto auto;width: 6cm;'><img style='height: 20px;width: 20px;' src='assets/images/messageIcon.png'><div style='    font-size: 14px;color: #7d6dd3;'>This Visitor was Invited</div></div>");
      const _self = this;
      var url = 'https://apis.justlogindevelopment.xyz/visitors/v2/invitation/' + name;
      if (this.is_from_dashboard) {
        url = 'https://apis.justlogindevelopment.xyz/visitors/v2/entry/' + name;
      }
      $.ajax({
        url: url,//"https://apis.justlogindevelopment.xyz/visitors/v2/details/" + name,
        type: 'GET',
        headers: {
          "Content-Type": "application/json",
          "Authorization": "Bearer " + this.ApiService.Token
        },
        success: function (res) {
          // this.toaster.success('updated successfully.');
          var obj = res;
          (<HTMLInputElement>document.getElementById("visitorImage")).src = obj['imageUrl'];
          $('#Name').val(obj['name']);
          $('#Email').val(obj['email']);
          $('#Contact').val(obj['mobile']);
          if (res && res.lastEntry && res.lastEntry.hosts && res.lastEntry.hosts.length > 0 && res.lastEntry.hosts[0].name) {
            $('#Host').val(res.lastEntry.hosts[0].name);
          }
          if (res && res.lastEntry && res.lastEntry.signing && res.lastEntry.signing.in) {
            $('#ArrivalDate').val(res.lastEntry.signing.in);
          }
          if (res && res.lastEntry && res.lastEntry.purpose) {
            $('#Purpose').val(res.lastEntry.purpose);
          }
          if (_self.checkin_service) {
            _self.invitation_id = res.id;
            _self.getCheckinInfo();
            _self.makeEntry(res);
          }

        }, error(err) {
          _self.toaster.error('Sorry there was a problem while loading. Please try again.');
          console.log('/visitors/v2/details/---' + err);
        }
      });
    }
  }
  getCheckinInfo() {
    if (this.invitation_id) {
      var _self = this
      $.ajax({
        url: "https://apis.justlogindevelopment.xyz/visitors/v2/details/" + this.invitation_id,
        type: 'GET',
        headers: {
          "Content-Type": "application/json",
          "Authorization": "Bearer " + this.ApiService.Token
        },
        success: function (res) {
          var obj = res;
          if (res && res.lastEntry && res.lastEntry.hosts && res.lastEntry.hosts.length > 0 && res.lastEntry.hosts[0].name) {
            $('#Host').val(res.lastEntry.hosts[0].name);
          }
          if (res && res.lastEntry && res.lastEntry.signing && res.lastEntry.signing.in) {
            $('#ArrivalDate').val(res.lastEntry.signing.in);
          }
          if (res && res.lastEntry && res.lastEntry.purpose) {
            $('#Purpose').val(res.lastEntry.purpose);
          }
        }, error(err) {
          _self.toaster.error('Sorry there was a problem while loading Check In Information. Please try again.');
          console.log('/visitors/v2/details/---' + err);
        }
      });
    }
  }
  checkinInfo(name) {
    if (name === "NewVisitor") {
      for (var i = 0; i < this.checkinInfoStructure.length; i++) {
        if (this.checkinInfoStructure[i]['FieldType'] == 'text field') {
          $('#div2').append("<div style='padding: 0px 22px 22px 0px;'><label style='color:rgb(141 141 141);'>" + this.checkinInfoStructure[i]['Field'] + "</label><br> <input type='text' id='" + this.checkinInfoStructure[i]['id'] + "' placeholder='" + this.checkinInfoStructure[i]['Field'] + "'  style='padding-left: 15px;border: none;border-bottom: 1px solid #bfbfbf;width: 100%;height: 28px;'></div>")
        }
      }
      $('#Location').val('');
      $('#ArrivalDate').val('');
      $('#VisitorType').val('');
      $('#ExpectedArrivalTime').val('');
      $('#ArrivalTime').val('');
      $('#Status').val('');
      $('#Remark').val('');
    }
    else {
      for (var i = 0; i < this.checkinInfoStructure.length; i++) {
        if (this.checkinInfoStructure[i]['FieldType'] == 'text field') {
          $('#div2').append("<div style='padding: 0px 22px 22px 0px;'><label style='color:rgb(141 141 141);'>" + this.checkinInfoStructure[i]['Field'] + "</label><br> <input type='text' id='" + this.checkinInfoStructure[i]['id'] + "' placeholder='" + this.checkinInfoStructure[i]['Placeholder'] + "'  style='padding-left: 15px;border: none;border-bottom: 1px solid #bfbfbf;width: 100%;height: 28px;' disabled></div>")
        }
      }
      for (var i = 0; i < this.data.length; i++) {
        if (name == this.data[i]['FullName']) {
          var obj = this.data[i];
        }
      }
      if (obj) {
        $('#Location').val(obj['Location']);
        $('#ArrivalDate').val(obj['date']);
        $('#VisitorType').val(obj['VisitorType']);
        $('#ExpectedArrivalTime').val(obj['ExpectedTime']);
        $('#ArrivalTime').val(obj['ArrivalTime']);
        $('#Status').val(obj['Status']);
        $('#Remark').val(obj['Remark']);
      }
    }
  }
